import React, {Component} from 'react';
import {connect} from "react-redux";


import { Table, Tag, Space } from 'antd';
import {dispatch} from "jest-circus/build/state";


const columns = [
    {
        title: '社团名称',
        dataIndex: 'name',
        key: 'name',
        render: text => <a>{text}</a>,
    },
    {
        title: 'Age',
        dataIndex: 'age',
        key: 'age',
    },
    {
        title: 'Address',
        dataIndex: 'address',
        key: 'address',
    },
    {
        title: '社团类型',
        key: 'type',
        dataIndex: 'type',
        render: type => (
            <span>
        {type.map(type => {
            let color = type.length > 5 ? 'geekblue' : 'green';
            if (type === 'loser') {
                color = 'volcano';
            }
            return (
                <Tag color={color} key={type}>
                    {type.toUpperCase()}
                </Tag>
            );
        })}
      </span>
        ),
    },
    {
        title: '操作',
        key: 'manage',
        render: () => (
            <Space size="middle">
                <a>修改</a>
                <a>删除</a>
            </Space>
        ),
    },
];

const data = [
    {
        key: '1',
        name: 'John Brown',
        age: 32,
        address: 'New York No. 1 Lake Park',
        type: ['nice', 'developer'],
    },
    {
        key: '2',
        name: 'Jim Green',
        age: 42,
        address: 'London No. 1 Lake Park',
        type: ['loser'],
    },
    {
