        address: 'Sidney No. 1 Lake Park',
        type: ['cool', 'teacher'],
    },
    {
        key: '11',
        name: 'Joe Black',
        age: 32,
        address: 'Sidney No. 1 Lake Park',
        type: ['cool', 'teacher'],
    },
    {
        key: '12',
        name: 'Joe Black',
        age: 32,
        address: 'Sidney No. 1 Lake Park',
        type: ['cool', 'teacher'],
    },
];




class Community extends Component {

    componentWillMount() {

}

    render() {
        return(
            <div className="communityList">

                <Table
                    columns={columns}
                    pagination={{ position: [ 'bottomCenter'] }}
                    dataSource={data}
                />

            </div>
        )
    }

}
const mapState = (state) => ({
    //data: state.getIn(['community','data'])
});
const mapDispatch = (dispatch) => ({
    // handleLogin(values){
    //     console.log(values);
